import React, { useEffect, useState } from 'react';
import api from './services/api';



useEffect(()=>{
  const [users, setUsers] = useState([]);
  api.get('/users').then(response => {
      setUsers(response.data);
  })
},[])

function App() {
  return (
    <div className="App">

    </div>
  );

}

export default App;
